{# CONTEXT #}
{%- set context = namespace(tag_index = {}, folders = [], result = {'name':'root', 'index':[], 'folders':{}, 'workflows': []} ) -%}
{# {'name': '', 'index': [], 'workflows': {'index': []} #}
{# FUNCTIONS #}
{%- macro title_case(arg_word) -%}
    {%- set arg_word = arg_word | lower -%}
    {%- set arg_word = (arg_word[0] | upper) + (arg_word[1:]) -%}
    {{ arg_word }}
{%- endmacro -%}
{%- macro normalize_name(arg_name) -%}
    {%- set parts = (arg_name | trim).split(' ') -%}
    {%- set titled = [] -%}
    {%- for part in parts -%}
        {%- do titled.append(title_case(part)) -%}
    {%- endfor -%}
    {%- set normalized = titled | join(' ') -%}
    {%- if normalized.startswith('[') and (not ']' in normalized) -%}
        {%- set normalized = (normalized[1] | upper) + (normalized[2:]) -%}
    {%- endif -%}
    {{ normalized }}
{%- endmacro -%}
{%- macro index_equals(source, target) -%}
    {%- set returns = {'result': true} -%}
    {%- for tag in source -%}
        {%- if not tag in target -%}
            {%- do returns.update({'result': false}) -%}
            {%- break -%}
        {%- endif -%}
    {%- endfor -%}
    {%- if returns.result -%}
        {%- for tag in target -%}
            {%- if not tag in source -%}
                {%- do returns.update({'result': false}) -%}
                {%- break -%}
            {%- endif -%}
        {%- endfor -%}
    {%- endif -%}
    {{ returns.result }}
{%- endmacro -%}
{%- macro folders_contains(folder_list, index) -%}
    {%- set returns = {'result': false} -%}
    {%- for folder in folder_list -%}
        {%- if index_equals(folder.index, index) -%}
            {%- do returns.update({'result': true}) -%}
            {%- break -%}
        {%- endif -%}
    {%- endfor -%}
    {{ returns.result }}
{%- endmacro -%}
{# MAIN #}
{%- for item in CTX.workflows -%}
    {%- set item_name = item.name | trim -%}
    {%- if item_name.startswith('[') -%}
        {%- set new_tag = { 'name': normalize_name(item_name | regex_substring('^\[(.*?)\]')) } -%}
        {%- for tag in item.tags -%}
            {%- if normalize_name(tag.name) == new_tag.name -%}
                {%- do new_tag.update({ 'name': '' }) -%}
                {%- break -%}
            {%- endif -%}
        {%- endfor -%}
        {%- if not new_tag.name == '' -%}
            {%- do item.tags.append(new_tag) -%}
            {%- if (new_tag.name | lower).startswith('rewst') -%}
                {%- if not {'name': 'Rewst'} in item.tags -%}
                    {%- do item.tags.append({'name': 'Rewst'}) -%}
                {%- endif -%}
            {%- endif -%}
        {%- endif -%}
    {%- endif -%}
    {%- set item_tags = [normalize_name(t.name) for t in item.tags] -%}
    {%- if item_tags | length > 0 -%}
        {%- if not folders_contains(context.folders, item_tags) -%}
            {%- do context.folders.append({'index': item_tags, 'workflows': []}) -%}
        {%- endif -%}
    {%- endif -%}
{%- endfor -%}
{%- for folder in context.folders -%}
    {%- do folder.update({'index': folder.index | sort}) -%}
{%- endfor -%}
{%- for item in CTX.workflows -%}
    {%- set item_tags = [normalize_name(t.name) for t in item.tags] -%}
    {%- if item_tags | length == 0 or item_tags[0] == '' -%}
        {%- do context.result.workflows.append(item) -%}
    {%- else -%}
        {%- for folder in context.folders -%}
            {%- if index_equals(folder.index, item_tags) -%}
                {%- set current = {'item': context.result} -%}
                {%- for t in folder.index -%}
                    {%- if not t in current.item.folders -%}
                        {%- do current.item.folders.update({ t:{'folders':{}, 'workflows':[]} }) -%}
                        {%- do current.update({'item': current.item.folders[t]})-%}
                    {%- else -%}
                        {%- do current.update({'item': current.item.folders[t]})-%}
                    {%- endif -%}
                {%- endfor -%}
                {%- do current.item.workflows.append(item) -%}
            {%- endif -%}
        {%- endfor -%}
    {%- endif -%}
{%- endfor -%}
{{ context.result }}

