{%- macro insert_folder(obj) -%}
    {%- for folder in [f for f in obj.folders | sort] -%}
        <li>
            <span class="toggle"><img src="{{ fldico }}" style="display: inline;"><img src="{{ oflico }}" style="display: none;"></span> {{ folder }}
            <ul>
            {{ insert_folder(obj.folders[folder]) }}
            </ul>
        </li>
    {%- endfor -%}
    {%- for workflow in obj.workflows -%}
        <li>{{ "<img src=\"" + wfico + "\">" if workflow.type == 'workflow' }}{{ "<img src=\"" + fmico + "\">" if workflow.type == 'form' }}<a href={{ "\"" }}{{'https://app.rewst.io/organizations/' + workflow.org_id + '/' + workflow.type + 's/' + workflow.id}}{{ "\"" }} target="_blank">{{ workflow.name }}</a></li>
    {%- endfor -%}
{%- endmacro -%}
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>REWST Folders!</title>
    <style>
        ul.treeview, ul.treeview ul {
            list-style: none;
            margin: 0;
            padding-left: 1em;
            position: relative;
        }
        ul.treeview ul {
            display: none;
        }
        ul.treeview .toggle {
            cursor: pointer;
            user-select: none;
            font-weight: bold;
        }
        ul.treeview .expanded > ul {
            display: block;
        }
        ul.treeview li {
            margin: 0.2em 0;
        }
    </style>
</head>
<body>
    <ul class="treeview" id="tree">
    {{ insert_folder(CTX.root) }}
    </ul>
    <script>
        document.querySelectorAll('.treeview .toggle').forEach(function(toggle) {
            toggle.addEventListener('click', function(e) {
                var target = e.target;
                if (e.target.tagName === 'IMG') {
                    target = e.target.parentElement;
                }
                const li = target.parentElement;
                li.classList.toggle('expanded');
                target.children[0].style.display = li.classList.contains('expanded') ? 'none' : 'inline'
                target.children[1].style.display = li.classList.contains('expanded') ? 'inline' : 'none';
            });
        });
    </script>
</body>
</html>
